// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ForgeNFT is ERC721, ERC721Enumerable, ERC721URIStorage, Ownable {
    ERC20 public paymentCurrency1;
    ERC20 public paymentCurrency2;
    ERC721 public requiredNFT;

    uint256 public requiredAmount1;
    uint256 public requiredAmount2;

    constructor(
        ERC20 _paymentCurrency1,
        ERC20 _paymentCurrency2,
        ERC721 _requiredNFT,
        uint256 _requiredAmount1,
        uint256 _requiredAmount2
    ) ERC721("ForgeNFT", "Forge") {
        require(
            address(_paymentCurrency1) != address(0),
            "Token address can't be address zero"
        );
        require(
            address(_paymentCurrency2) != address(0),
            "Token address can't be address zero"
        );
        require(address(_requiredNFT) != address(0), "Addresss can't be zero");
        require(_requiredAmount1 > 0, "amount cannot be zero");
        require(_requiredAmount2 > 0, "amount cannot be zero");
        paymentCurrency1 = _paymentCurrency1;
        paymentCurrency2 = _paymentCurrency2;
        requiredNFT = _requiredNFT;
        requiredAmount1 = _requiredAmount1;
        requiredAmount2 = _requiredAmount2;
    }

    //Setter Functions

    function setPaymentCurrency1(ERC20 _paymentCurrency) public onlyOwner {
        require(
            address(_paymentCurrency) != address(0),
            "Token address can't be address zero"
        );
        paymentCurrency1 = _paymentCurrency;
    }

    function setPaymentCurrency2(ERC20 _paymentCurrency) public onlyOwner {
        require(
            address(_paymentCurrency) != address(0),
            "Token address can't be address zero"
        );
        paymentCurrency2 = _paymentCurrency;
    }

    function setRequiredNFT(ERC721 _requiredNFT) public onlyOwner {
        require(address(_requiredNFT) != address(0), "Address can't be zero");
        requiredNFT = _requiredNFT;
    }
    function setRequiredAmount1(uint256 _requiredAmount) public onlyOwner {
        require(_requiredAmount > 0, "Amount cannot be zero");
        requiredAmount1 = _requiredAmount;
    }

    function setRequiredAmount2(uint256 _requiredAmount) public onlyOwner {
        require(_requiredAmount > 0, "Amount cannot be zero");
        requiredAmount2 = _requiredAmount;
    }

    // buy function    }

    function buyForge() public {
        require(
            paymentCurrency1.transferFrom(
                msg.sender,
                address(this),
                requiredAmount1
            ),
            "Failed to process payment for currency 1!"
        );
        require(
            paymentCurrency2.transferFrom(
                msg.sender,
                address(this),
                requiredAmount2
            ),
            "Failed to process payment for currency 2!"
        );
        uint256 tokenId = totalSupply(); // Use totalSupply() to get the next token ID
        _safeMint(msg.sender, tokenId);
        _setTokenURI(
            tokenId,
            "https://gateway.pinata.cloud/ipfs/Qmbkgns6q5tum8YuL2FEQzWscBZNgcTCxYQkeDvMx2itNd"
        );
    }

    // The following functions are overrides required by Solidity.

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function _burn(
        uint256 tokenId
    ) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(
        bytes4 interfaceId
    )
        public
        view
        override(ERC721, ERC721Enumerable, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
